// import React from 'react'
import { useNavigate } from 'react-router-dom';
import React, { useState } from 'react';
import './Login.css'
import due from "./image/due.jpg";
import cutm from "./image/cutm.png"

// function Login() {
  const Login = () => {
    const history = useNavigate();
  
    const handleLogin = () => {
      
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
//   const history = useNavigate();

  const handleUsernameChange = (event) => {
    setUsername(event.target.value);
  };

  const handlePasswordChange = (event) => {
    setPassword(event.target.value);
  };

  const handleLogin = async () => {
    // In a real application, you'd make an API request to the server for authentication
    if (username === 'Guru' && password === '1234') {
      // Simulate successful authentication
      history.push('/profile'); // Redirect to profile page on successful login
    } else {
      alert('Invalid credentials. Please try again.');
    }
  };

  return (
    <div>
      <input
        type="text"
        placeholder="Username"
        value={username}
        onChange={handleUsernameChange}
      />
      <input
        type="password"
        placeholder="Password"
        value={password}
        onChange={handlePasswordChange}
      />
      <button onClick={handleLogin}>Login</button>
    </div>

  );

  history.push('/profile');
    
  };

//   return (
    <div>
      <div className='main'>
        <div className='tittle'>
        <img src={cutm} alt="cutm" className='cutm'/>
          <h1><i><u>Online</u></i></h1>
          <h2><i><u>No Due</u></i></h2>
        </div>
        <div className='sub'>
          <div className='due_b'>
            <img src={due} alt="due" className='due'/>
          </div>
          <div className='info'>
          <input type="text" placeholder="Username" className="name"/><br></br>
          <input type="password" placeholder="Password" className="pass"/>
            <div className='login_button'>
            <button onClick={handleLogin}>Login</button>

            <p className='link'>
              <a href='#'>Forgot Password  </a>Or<a href='#'>  Sign in</a>
            </p>
            
            </div>
          </div>
        </div>
      </div>
    </div>
   
};



export default Login;
